using ImageCasterCore.Collectors;
using Xunit;

namespace ImageCasterCoreTest.Collectors
{
    public class Base64CollectorTest
    {
        private const string DataWithoutContentType = "";

        private const string DataWithContentType = "data:image/png;name=Elypia-chan_Attributed_by_Vukory.png;base64,";
        
        [Fact]
        public void TestDataWithoutContentType()
        {
            Base64Collector collector = new Base64Collector();

            const string expected = "564231D308E80A46D33BC5A9C07813B8.png";
            string actual = collector.Collect(DataWithoutContentType)[0].Name;
            
            Assert.Equal(expected, actual);
        }
        
        [Fact]
        public void TestWithContentType()
        {
            Base64Collector collector = new Base64Collector();

            const string expected = "Elypia-chan_Attributed_by_Vukory.png";
            string actual = collector.Collect(DataWithContentType)[0].Name;
            
            Assert.Equal(expected, actual);
        }

        [Fact]
        public void TestGenerateName()
        {
            Base64Collector collector = new Base64Collector();

            const string expected = "6CD3556DEB0DA54BCA060B4C39479839.png";
            string actual = collector.GenerateName("Hello, world!");

            Assert.Equal(expected, actual);
        }
    }
}
